import React, { Component } from "react";

class TextArea extends Component{

  show_result(event){
    this.props.onClick();
  }


  render(){
    return(
      <div>
        <center>
          <button onClick = {this.show_result.bind(this)}></button>
        </center>
      </div>
    );
  }
}

export default TextArea;
